INSERT INTO `gm19d_content` VALUES (1,36,'About','about','<h2><strong>Mahanakorn Network Research Laboratory</strong></h2>\r\n<p style=\"text-align: justify;\">ศูนย์วิจัยและปฏิบัติการด้านเครือข่าย ทำงานภายใต้ คณะวิทยาการและเทคโนโลยีสารสนเทศ มหาวิทยาลัยเทคโนโลยีมหานคร เราจะเป็นศูนย์กลาง การศึกษา การแลกเปลี่ยนองค์ความรู้ การทำวิจัยทางด้านระบบเครือข่าย เป็นที่ฝึกฝนทักษะเชิงปฏิบัติการ นอกจากนี้เรายังให้บริการช่วยเหลือเกี่ยวกับพัฒนาระบบเครือข่าย ไม่ว่าจะเป็นการให้คำแนะนำทางด้านการออกแบบ การวิเคราะห์แก้ไขปัญหา การสำรวจระบบเครือข่าย และการพัฒนาระบบเครือข่ายด้วยเครื่องมือที่มีประสิทธิภาพและได้มาตรฐานสากล อีกทั้งยังเป็นการส่งเสริมให้นักศึกษาได้เรียนรู้ได้ประสบการณ์จากงานจริง</p>\r\n<p> </p>\r\n<div class=\"col-sm-4\"><img class=\"img-circle img-responsive img-center\" style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"http://www.mnr.mut.ac.th/Home/IMG/TG.png\" alt=\"\" />\r\n<h2><span style=\"text-decoration: underline;\"><strong>Training Group</strong></span></h2>\r\n<p style=\"text-align: justify;\">เราคือกลุ่มงานที่มุ่งเน้น กิจกรรมการให้ความรู้ การอบรมเชิงปฏิบัติ ภายใต้กรอบความคิดที่ว่า \"เราจะเป็นสังคมแห่งการเรียนรู้\" สืบสานและสร้างวัฒนธรรม การถ่ายทอดองค์ความรู้ ประสบการณ์ จากรุ่นสู่รุ่น</p>\r\n</div>\r\n<div class=\"col-sm-4\"><img class=\"img-circle img-responsive img-center\" style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"http://www.mnr.mut.ac.th/Home/IMG/BS.png\" alt=\"\" />\r\n<h2><strong><span style=\"text-decoration: underline;\">MNR Blog</span></strong></h2>\r\n<p style=\"text-align: justify;\">เป็นที่รวบรวมบทความต่างๆ ที่เกี่ยวข้องกับด้านเครือข่าย ด้านความมั่นคงปลอดภัย และด้านการบริหารจัดการระบบ รวมถึงตัวแบบฝึกหัดอิเล็กทรอนิกส์ อาทิเช่น Packet Tracer , VMware , GNS3 และ UNetlab</p>\r\n</div>\r\n<div class=\"col-sm-4\"><img class=\"img-circle img-responsive img-center\" style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"http://www.mnr.mut.ac.th/Home/IMG/WG.png\" alt=\"\" />\r\n<h2><span style=\"text-decoration: underline;\"><strong>Working Group</strong></span></h2>\r\n<p style=\"text-align: justify;\">กลุ่มที่มุ้งเน้นงานการบริการสังคม ให้การช่วยเหลือการพัฒนา หรือวิเคราะห์ปัญหาทางด้านระบบเครือข่าย อาทิเช่น Wireless Site Survey การออกแบบระบบเครือข่ายไร้สาย การวิเคราะห์ปัญหาระบบเครือข่าย</p>\r\n</div>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"><strong>Mahanakorn University of Technology, 140 Cheumsampan Rd, Nongchok, Bangkok, Thailand 10530 Tel. +66 (0) 2988-3655, +66 (0) 2988-3656 ,Email: MNR-TG@mut.ac.th</strong></p>','',1,2,'2018-05-04 16:08:16',111,'admin','2018-05-04 16:40:58',111,0,'0000-00-00 00:00:00','2018-05-04 16:08:16','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',5,2,'','',1,26,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(2,37,'Working on Your Site','working-on-your-site','<p>Here are some basic tips for working on your site.</p><ul><li>Joomla! has a \"front end\" that you are looking at now and an \"administrator\" or \"back end\" which is where you do the more advanced work of creating your site such as setting up the menus and deciding what modules to show. You need to login to the administrator separately using the same user name and password that you used to login to this part of the site.</li><li>One of the first things you will probably want to do is change the site title and tag line and to add a logo. To do this click on the Template Settings link in the top menu. To change your site description, browser title, default email and other items, click Site Settings. More advanced configuration options are available in the administrator.</li><li>To totally change the look of your site you will probably want to install a new template. In the Extensions menu click on Extensions Manager and then go to the Install tab. There are many free and commercial templates available for Joomla.</li><li>As you have already seen, you can control who can see different parts of you site. When you work with modules, articles or weblinks setting the Access level to Registered will mean that only logged in users can see them</li><li>When you create a new article or other kind of content you also can save it as Published or Unpublished. If it is Unpublished site visitors will not be able to see it but you will.</li><li>You can learn much more about working with Joomla from the <a href=\"https://docs.joomla.org/\">Joomla documentation site</a> and get help from other users at the <a href=\"https://forum.joomla.org/\">Joomla forums</a>. In the administrator there are help buttons on every page that provide detailed information about the functions on that page.</li></ul>','',0,2,'2018-05-04 16:08:16',111,'Joomla','2018-05-04 16:08:16',111,0,'0000-00-00 00:00:00','2018-05-04 16:08:16','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\"}',2,1,'','',3,8,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(3,38,'Welcome to MNR Python','welcome-to-your-blog','<h2 class=\"section-heading\">ประกาศรายชื่อผู้มีสิทธิ์ได้เข้าอบรม \"Python for network engineer &amp; system admin\"</h2>\r\n<p>     MNR ขอแสดงความยินดีกับผู้ที่ได้รับสิทธิ์เข้าอบรมในครั้งนี้ และในเบื้องต้นให้ท่านทำการตรวจสอบรายชื่อของท่าน ว่ามีปรากฏอยู่ในตารางด้านล่างหรือไม่</p>\r\n<p>สำหรับผู้ที่ได้รับสิทธิ์ <span style=\"color: green;\">(ยืนยันแล้ว)</span> หมายถึงได้ยืนยันสิทธิ์เข้าอบรมกับทีมงานแล้ว ส่วนผู้ที่ได้รับสิทธิ์ <span style=\"color: orange;\">(รอการยืนยัน)</span> หมายถึงยังไม่ได้ยืนยันสิทธิ์เข้าอบรม ท่านจะต้องทำการแจ้งข้อมูล เพื่อยืนยันสิทธิ์ รายละเอียดดังนี้</p>\r\n<p>หัวข้อ : ยืนยันสิทธิ์เข้าอบรม \"Python for network engineer &amp; system admin \"<br /> 1) ลำดับที่ได้รับสิทธิ์<br /> 2) ชื่อ-นามสกุล<br /> 3) เบอร์โทรศัพท์ (ตามข้อมูลที่ท่านลงทะเบียน)</p>\r\n<p>โดยส่งมาที่ <a href=\"mailto:MNR-TG@mut.ac.th\">MNR-TG@mut.ac.th</a> <strong><u><span style=\"color: red;\">ไม่เกิน วันพุธที่ 2 พฤษภาคม 2561</span></u></strong> <!--หรือถ้าไม่สะดวกสามารถยืนยันได้ผ่านทางการโทรได้ที่เบอร์ 085-257-0604 (เวลาทำการ  9.00 น. - 17.00 น.) --><br /> <br /> <span style=\"color: orange;\">     ขอแสดงความเสียใจกับผู้ที่ไม่ได้รับสิทธิ์ในครั้งนี้ด้วยค่ะ ทางคณะกรรมการได้พยายามคัดเลือกอย่างสุดความสามารถแล้ว เนื่องจากมีผู้สมัครเข้าอบรมมาเป็นจำนวนมาก และทาง MNR จะมีหัวข้ออบรมที่น่าสนใจไม่แพ้กันจัดขึ้นอีกแน่นอน โปรดติดตามได้ผ่านทางแฟนเพจอย่างใกล้ชิด</span></p>\r\n<p><strong><span style=\"color: red;\">*แจ้งการเตรียมการสำหรับผู้เข้าอบรม</span></strong><br /> กรุณาเตรียม Notebook ของท่าน พร้อมทั้งติดตั้งโปรแกรม <strong>Python</strong> และ <strong>Python Modules</strong></p>\r\n<h2>ดาวน์โหลดเอกสารวิธีการติดตั้ง <a href=\"http://www.mnr.mut.ac.th/TG/file/Python/Python_Preparation.docx\" download=\"\"> <strong><span style=\"color: red;\">Click!!</span></strong></a></h2>\r\n<p><img src=\"http://www.mnr.mut.ac.th/TG/img/python3.png\" /></p>\r\n<h3><span style=\"color: red;\">update: 03/05/2561 (09.00 P.M.)</span></h3>\r\n<p>เวลาอบรมเริ่มต้นใน <strong>วันเสาร์ ที่ 5 พฤษภาคม 2561</strong> สถานที่อบรม <strong>อาคาร MII ห้อง 208</strong></p>\r\n<h2>(นักศึกษา/ศิษย์เก่าของคณะฯ)</h2>\r\n<table class=\"table table-striped\">\r\n<thead>\r\n<tr>\r\n<th>ลำดับที่</th>\r\n<th>ชื่อ</th>\r\n<th>สกุล</th>\r\n<th>สถานะ</th>\r\n</tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<td>1</td>\r\n<td>คุณดนัย</td>\r\n<td>วงษ์เนตร</td>\r\n<th><span style=\"color: green;\">(ยืนยันแล้ว)</span></th>\r\n</tr>\r\n<tr>\r\n<td>2</td>\r\n<td>คุณพงศ์ภัทร์</td>\r\n<td>รักเดช</td>\r\n<th><span style=\"color: green;\">(ยืนยันแล้ว)</span></th>\r\n</tr>\r\n<tr>\r\n<td>3</td>\r\n<td>คุณสายชล</td>\r\n<td>บุญบำรุง</td>\r\n<th><span style=\"color: green;\">(ยืนยันแล้ว)</span></th>\r\n</tr>\r\n<tr>\r\n<td>4</td>\r\n<td>คุณประกาศิต</td>\r\n<td>ยอดศิลป์</td>\r\n<th><span style=\"color: green;\">(ยืนยันแล้ว)</span></th>\r\n</tr>\r\n<tr>\r\n<td>5</td>\r\n<td>คุณปวริศ</td>\r\n<td>จินตนาปราโมทย์</td>\r\n<th><span style=\"color: green;\">(ยืนยันแล้ว)</span></th>\r\n</tr>\r\n<tr>\r\n<td>6</td>\r\n<td>คุณวิทวัฒน์</td>\r\n<td>มัสอารีย์</td>\r\n<th><span style=\"color: green;\">(ยืนยันแล้ว)</span></th>\r\n</tr>\r\n<tr>\r\n<td>7</td>\r\n<td>คุณสิรวุฒิ</td>\r\n<td>ภู่เกษร</td>\r\n<th><span style=\"color: green;\">(ยืนยันแล้ว)</span></th>\r\n</tr>\r\n<tr>\r\n<td>8</td>\r\n<td>คุณเอกชัย</td>\r\n<td>เตชพรรุ่ง</td>\r\n<th><span style=\"color: green;\">(ยืนยันแล้ว)</span></th>\r\n</tr>\r\n<tr>\r\n<td>9</td>\r\n<td>คุณรัฐกร</td>\r\n<td>ทองเรือง</td>\r\n<th><span style=\"color: red;\">(สละสิทธิ์)</span></th>\r\n</tr>\r\n<tr>\r\n<td>10</td>\r\n<td>คุณศุภวัฒน์</td>\r\n<td>มัสอารีย์</td>\r\n<th><span style=\"color: red;\">(สละสิทธิ์)</span></th>\r\n</tr>\r\n<tr>\r\n<td>11</td>\r\n<td>คุณกฤษณพงศ์</td>\r\n<td>ช่วยชู</td>\r\n<th><span style=\"color: green;\">(ยืนยันแล้ว)</span></th>\r\n</tr>\r\n<tr>\r\n<td>12</td>\r\n<td>คุณเมฆินทร์</td>\r\n<td>วรศาสตร์</td>\r\n<th><span style=\"color: green;\">(ยืนยันแล้ว)</span></th>\r\n</tr>\r\n<tr>\r\n<td>13</td>\r\n<td>คุณอานนท์</td>\r\n<td>โอชวงษ์</td>\r\n<th><span style=\"color: green;\">(ยืนยันแล้ว)</span></th>\r\n</tr>\r\n<tr>\r\n<td>14</td>\r\n<td>คุณสิรภูมิ</td>\r\n<td>เพ็ชรโต</td>\r\n<th><span style=\"color: green;\">(ยืนยันแล้ว)</span></th>\r\n</tr>\r\n<tr>\r\n<td>15</td>\r\n<td>คุณสัณหกิจ</td>\r\n<td>ว่องรัตนพิทักษ์</td>\r\n<th><span style=\"color: green;\">(ยืนยันแล้ว)</span></th>\r\n</tr>\r\n<tr>\r\n<td>16</td>\r\n<td>คุณกิตติพศ</td>\r\n<td>เจริญสิน</td>\r\n<th><span style=\"color: green;\">(ยืนยันแล้ว)</span></th>\r\n</tr>\r\n<tr>\r\n<td>17</td>\r\n<td>คุณวงศกร</td>\r\n<td>ทวะชารี</td>\r\n<th><span style=\"color: green;\">(ยืนยันแล้ว)</span></th>\r\n</tr>\r\n<tr>\r\n<td>18</td>\r\n<td>คุณศุภกร</td>\r\n<td>โลหะสัมมากุล</td>\r\n<th><span style=\"color: green;\">(ยืนยันแล้ว)</span></th>\r\n</tr>\r\n<tr>\r\n<td>19</td>\r\n<td>คุณวิศาล</td>\r\n<td>กิมเสม</td>\r\n<th><span style=\"color: green;\">(ยืนยันแล้ว)</span></th>\r\n</tr>\r\n<tr>\r\n<td>20</td>\r\n<td>คุณศราวุธ</td>\r\n<td>ลิ้มดำรงค์ชิต</td>\r\n<th><span style=\"color: green;\">(ยืนยันแล้ว)</s